package basicStruct;

public class StrIntTuple {
	private String c;
	private int i;

	public StrIntTuple() {
		super();
		// TODO Auto-generated constructor stub
	}

	public StrIntTuple(String c, int i) {
		super();
		this.c = c;
		this.i = i;
	}

	public String getC() {
		return c;
	}

	public int getI() {
		return i;
	}

	public void setC(String c) {
		this.c = c;
	}

	public void setI(int i) {
		this.i = i;
	}

}
